import React from "react";
import { Modal, Form, Input, InputNumber } from "antd";

const CustomModal = ({ visible, onCancel, onhandleAdd, editData }) => {
  return (
    <Modal centered closable={false} visible={visible} onCancel={onCancel}>
      <Form
        onFinish={onhandleAdd(editData)}
        hideRequiredMark={true}
        initialValues={{
          name: editData.name,
          price: editData.price,
          type: editData.type,
          date: editData.date
        }}
      >
        <Form.Item
          label="Name"
          name="name"
          rules={[
            {
              required: true,
              message: "Please input  name!"
            }
          ]}
          colon="fdsf"
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="Price"
          name="price"
          rules={[
            {
              required: true,
              message: "Please input price!"
            }
          ]}
        >
          <InputNumber />
        </Form.Item>
        <Form.Item
          label="Type"
          name="type"
          rules={[
            {
              required: true,
              message: "Please input type!"
            }
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="Date"
          name="date"
          rules={[
            {
              required: true,
              message: "Please input date!"
            }
          ]}
        >
          <Input showTime />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default CustomModal;
